import styled from "styled-components";

export const Item = styled.div`
  height: 100%;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
`;
export const ImgItem = styled.img`
  width: 10vw;
  height: 10vh;
`;
export const HeroSlides = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;
